extensive_correct.code:
import { RuptelaEventEnum } from 'akeyless-types-commons';

function processRuptelaEvent(eventId: RuptelaEventEnum): string {
    switch (eventId) {
        case RuptelaEventEnum.location:       return 'location update';
        case RuptelaEventEnum.ignition_on:    return 'ignition on';
        case RuptelaEventEnum.ignition_off:   return 'ignition off';
        case RuptelaEventEnum.engine_on:      return 'engine on';
        case RuptelaEventEnum.engine_off:     return 'engine off';
        case RuptelaEventEnum.power_cut_on:   return 'power cut on';
        case RuptelaEventEnum.power_cut_off:  return 'power cut off';
        case RuptelaEventEnum.charging_on:    return 'charging started';
        case RuptelaEventEnum.charging_off:   return 'charging stopped';
        default:                              return 'unknown event';
    }
}

